double MSSM::matrixHard_gu_suLsuRubar(const double alphas, std::array<std::array<double, 4>, 5> const &p) const {
   const double k12 = p[0][0]*p[1][0]-p[0][3]*p[1][3];
   const double k13 = p[0][0]*p[2][0]-p[0][3]*p[2][3];
   const double k35 = p[2][0]*p[4][0]-p[2][1]*p[4][1]-p[2][2]*p[4][2]-p[2][3]*p[4][3];
   const double T15 = -2*(p[0][0]*p[4][0]-p[0][3]*p[4][3]);
   const double T25 = -2*(p[1][0]*p[4][0]-p[1][3]*p[4][3]);
   const double S   = 2*k12;
   const double T   = pow<2>(MassSq) - 2*k13;
   const double S35 = pow<2>(MassSq) + 2*k35;
   const double MassGlu2 = pow<2>(MassGlu);
   const double MassSq2 = pow<2>(MassSq);
   const double res = (16*(-52*MassSq2 - 62*S + 74*S35 - 52*T - 58*T15 - T25))/(9.*pow<2>(MassGlu2 - 3*MassSq2 + S + S35 + T + T15 + T25)) + (16*(-24*MassSq2 + 6*S + 12*S35 - 18*T + 22*T15 + 3*T25))/(9.*pow<2>(MassGlu2 + MassSq2 - S35 - T - T15)) + (16*(8*pow<2>(MassSq2) - 7*MassSq2*S + 8*MassSq2*S35 + 6*S*S35 - 10*(S35*S35) - 24*MassSq2*T + 8*S*T + 12*S35*T + 6*(T*T) + 3*MassSq2*T25 - 5*S35*T25 - T*T25))/(9.*pow<2>(MassGlu2 + MassSq2 - S35 - T - T15)*T15) + (16*(S*(S35*S35) + 2*pow<3>(S35) - S*S35*T - 6*(S35*S35)*T + 6*S35*(T*T) - 2*pow<3>(T) + 2*(S35*S35)*T25 - 2*S35*T*T25))/(9.*(MassSq2 - T)*pow<2>(MassGlu2 + MassSq2 - S35 - T - T15)*T15) + (16*(2*S*S35 - 2*(S35*S35) - S*T + 51*S35*T - 49*(T*T) + S*T15 - 10*S35*T15 + 57*T*T15 - 6*(T15*T15) - 4*S35*T25 + 14*T*T25 - 6*T15*T25))/(9.*(MassSq2 - T)*pow<2>(MassGlu2 + MassSq2 - S35 - T - T15)) + (16*(-81*(S*S) + 110*S*S35 - 30*(S35*S35) - 158*S*T + 107*S35*T - 77*(T*T) - 150*S*T15 + 101*S35*T15 - 148*T*T15 - 73*(T15*T15) + 6*S*T25 - 30*S35*T25 + 3*T*T25 + T15*T25))/(9.*(MassSq2 - S - T - T15)*pow<2>(MassGlu2 - 3*MassSq2 + S + S35 + T + T15 + T25)) + (16*(-16*pow<3>(S) + 32*(S*S)*S35 - 16*S*(S35*S35) - 48*(S*S)*T + 64*S*S35*T - 16*(S35*S35)*T - 48*S*(T*T) + 32*S35*(T*T) - 16*pow<3>(T) - 48*(S*S)*T15 + 64*S*S35*T15 - 16*(S35*S35)*T15 - 96*S*T*T15 + 64*S35*T*T15 - 48*(T*T)*T15 - 48*S*(T15*T15) + 32*S35*(T15*T15) - 48*T*(T15*T15) - 16*pow<3>(T15) - 16*S*S35*T25 - 16*S35*T*T25 - 16*S35*T15*T25))/(9.*pow<2>(MassSq2 - S - T - T15)*pow<2>(MassGlu2 - 3*MassSq2 + S + S35 + T + T15 + T25)) + (16*(-16*(S35*S35)*T + 32*S35*(T*T) - 16*pow<3>(T) - 32*S35*T*T15 + 32*(T*T)*T15 - 16*T*(T15*T15) - 16*S35*T*T25 - 16*T*T15*T25))/(9.*pow<2>(MassSq2 - T)*pow<2>(MassGlu2 + MassSq2 - S35 - T - T15)) + (16*(8*pow<2>(MassSq2) - 3*MassSq2*S - 4*(S*S) + 8*MassSq2*S35 + 8*S*S35 - 10*(S35*S35) - 24*MassSq2*T + 2*S*T + 12*S35*T + 6*(T*T) - MassSq2*T25 + 5*S*T25 - 11*S35*T25 + 9*T*T25 - T25*T25))/(9.*T15*pow<2>(MassGlu2 - 3*MassSq2 + S + S35 + T + T15 + T25)) + (16*(-4*pow<3>(S) + 9*(S*S)*S35 - 7*S*(S35*S35) + 2*pow<3>(S35) - 10*(S*S)*T + 15*S*S35*T - 6*(S35*S35)*T - 8*S*(T*T) + 6*S35*(T*T) - 2*pow<3>(T) + 5*(S*S)*T25 - 8*S*S35*T25 + 4*(S35*S35)*T25 + 7*S*T*T25 - 6*S35*T*T25 + 2*(T*T)*T25 - S*(T25*T25) + 2*S35*(T25*T25)))/(9.*(MassSq2 - S - T - T15)*T15*pow<2>(MassGlu2 - 3*MassSq2 + S + S35 + T + T15 + T25));
   return pow<3>(alphas*pi)*res;
}